import { username } from '../src/App';

const fetchUrl = () => {
    fetch("https://api.github.com/users/"+username)
      .then(res => res.json())
      .then(
        (result) => {
          console.log(result);
        },
        (error) => {
          console.log(error);
        }
      )
}
